import React, { Component } from 'react';
import PropTypes from 'prop-types';

const ToolBoxCard = () => {
	return <a className="toolbox">Toolbox</a>
}

class Projects extends Component {

	render() {
	    return (<div className="Projects">
	    	<ToolBoxCard />
	    </div>);
	}
}

Projects.propTypes = {
}

export default Projects;
